public class BowlingGameTest extends TestCase{

	private Game g;	

	protected void setUp() throws Exception {
		g = new Game();
	}


	private void rollMany(int n, int pins) {
		for (int i = 0; i < n; i++) {
			g.roll(pins);
		}
	}


